function MovieCard({movies}) {


  return (
    
    <div>
        <strong>{movies.id}</strong>
        <strong>{movies.title}</strong>
        <div>{movies.director}</div>
        <div>{movies.year}</div>
        <div>{movies.duration}</div>
    </div>
  )
}
export default MovieCard
